column8:
雨の日のお出かけが楽しくなるようなオシャレなチェック柄のジャンプ傘♪「先染め生地」は、あらかじめ糸の段階から染色加工を行う事により、1本1本の色糸が微妙な色のハーモニーを奏で、織物の持つ独特の風合いを楽しめます。匠の名人技で一本一本手作りした本物志向の逸品です。<table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">雨の日のお出かけが楽しくなるようなオシャレなチェック柄のジャンプ傘♪「先染め生地」は、あらかじめ糸の段階から染色加工を行う事により、1本1本の色糸が微妙な色のハーモニーを奏で、織物の持つ独特の風合いを楽しめます。匠の名人技で一本一本手作りした本物志向の逸品です。</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td align="left"><font color="#333333" size="-1">60cm×8本骨、全長:89cm、開傘時直径:約101cm</font><br><font color="#333333" size="-1">個装サイズ：95×16×5cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">430g</font><br><font color="#333333" size="-1">個装重量：720g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">素材・材質</font></td><td align="left"><font color="#333333" size="-1">生地:ポリエステル100％<br>骨:鉄<br>シャフト:アルミ<br>持ち手:合板木</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td><td align="left"><font color="#333333" size="-1">ワンタッチ式</font><br></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">日本</font></td></tr></table><br><font color="#333333" size="-1">販売会社/広告文責<br>株式会社Hanbit<br>Tel 050-1040-7307</font><style type="text/css">
